import {ITodoItem} from './ITodoItem'

import {ITodo} from '../types/data'
interface ITodoListProps{
    items: ITodo[];
}
const TodoList: React.FC<ITodoListProps> = (props) => {
    return <div>
        {
            props.items.map(todo => <ITodoItem key={todo.id} {...todo}/>)
        }
        </div>
}

export {
    TodoList
}
